%spark
// this example leverages work from https://github.com/larsbkrogvig/strava-spark/ (Lars Bakke Krogvig)

//a previous tutorial placed the csv file into your Object Store citibike container
//notice the use of the swift://CONTAINER.default/ syntax
val Container = "journeyC"
val Directory = "strava/raw/DBAYARD"
//val Directory = "strava/raw/DBAYARD2018"

//sqlContext.setConf("spark.sql.shuffle.partitions", "200")
//sqlContext.setConf("spark.sql.files.maxPartitionBytes", "65536")

//val df = sqlContext.read.format("com.databricks.spark.csv").option("header", "true").load("swift://"+Container+".default/"+Directory+"/raw/201612-citibike-tripdata.csv")
//We will use the bdfs (alluxio) cached file system to access our object store data...
//var df = sqlContext.read.format("com.databricks.spark.xml").option("rowTag","trkpt").load("bdfs://localhost:19998/"+Directory+"/Jan13_Morning_Ride.gpx")
//var df = sqlContext.read.format("com.databricks.spark.xml").option("rowTag","trkpt").load(Directory+"/*.gpx")
var df = sqlContext.read.format("com.databricks.spark.xml").option("rowTag","trkpt").option("samplingRatio","0.1").load(Directory+"/*.gpx")

// If you get this error message:
// java.lang.IllegalStateException: Cannot call methods on a stopped SparkContext.
// Then go to the Settings tab, then click on Notebook.  Then restart the Notebook.  This will restart your SparkContext


println("Here is the schema detected from the GPX")
df.printSchema()
println("..")

df.select(input_file_name()).first()

println("# of rows: %s".format(
  df.count() 
)) 
println("..")



println("done")

%spark

var df2 = df.withColumn("filename", input_file_name()).withColumnRenamed("_lat","lat").withColumnRenamed("_lon","lon")

//use regexp to extract ATHLETE and ACTIVITYTYPE
//hint: here is a great site: https://regexr.com/
// use this as a sample filename hdfs://dcbjan4-bdcsce-1.compute-gse00010212.oraclecloud.internal:8020/user/zeppelin/strava/raw/DBAYARDSMALL/20180101-143310-Run.gpx
//note: we added an extra \ to escape the \ character in scala quotes
df2 = df2.withColumn("athlete",regexp_extract(col("filename"),"""(\w+(?=\/\d*-\d*-.*gpx))""",1)).withColumn("activityType",regexp_extract(col("filename"),"(\\w+(?=\\.gpx))",1)).withColumn("activityName",regexp_extract(col("filename"),"""(\w*-\w*-\w*(?=\.gpx))""",1))
//df2 = df2.withColumn("athlete",lit("dbayard")).withColumn("activityType",regexp_extract(col("filename"),"(\\w+)",1))


//df2 = df2.select(df2.col("athlete"),df2.col("activityType"),df2.col("time"),df2.col("lat"),df2.col("lon"),df2.col("ele"))
df2 = df2.select(df2.col("athlete"),df2.col("activityType"),df2.col("activityName"),df2.col("time"),df2.col("lat"),df2.col("lon"),df2.col("ele"),df2.col("extensions.gpxtpx:TrackPointExtension.gpxtpx:hr").alias("heart_rate"))


df2.printSchema()

df2.first()

//share this with Python
z.put("myScalaDataFrame", df2)

//df2.createOrReplaceTempView("activity_temp")

